import React from "react";

const Detail = ({ key, subject, name, message, email }) => {
  return (
    <tr>
      <td key={`${key}${name}`}>{name}</td>
      <td key={`${key}${email}`}>{email}</td>
      <td key={`${key}${subject}`}>{subject}</td>
      <td key={`${key}${message}`}>{message}</td>
    </tr>
  );
};

export default Detail;
